  var cards = [
    {"image":"https://s3-us-west-2.amazonaws.com/s.cdpn.io/331810/sample87.jpg", 
  "title":"Burgundy Flemming", 
  "subtitle":"Advertising"},
 {"image":"https://s3-us-west-2.amazonaws.com/s.cdpn.io/331810/sample119.jpg", 
  "title":"Nigel Nigel", 
  "subtitle":"Sound & Vision"},
 {"image":"https://s3-us-west-2.amazonaws.com/s.cdpn.io/331810/sample120.jpg", 
  "title":"Caspian Bellevedere", 
  "subtitle":"Accounting"}
];
  useEffect(()=>{
    Aos.init({duration:4000});
},[]);
  return (  <div   >
    <Welcome/>

   <section id="events">    <EventsParent/> </section>
 <div 


 className='j2'>
 <section id="clubs">    <div  
  data-aos="flip-left"
  data-aos-easing="ease-out-cubic"
  data-aos-duration="2000"
  data-aos-offset="200"
  data-aos-delay="50"
  data-aos-duration="1000"
  data-aos-easing="ease-in-out"
  data-aos-mirror="true"
  data-aos-once="false"
  data-aos-anchor-placement="top-center">  <ClubSlider /> </div> </section> 



    </div> 

    <div className='app'>
               <h3>Cards</h3>
               <News data={cards} />
           </div>

  </div>

   );
}

export default App;
